## The need

The Win32 API has many cases of variable-length arrays embedded inside structures, for example the `SID` struct in `winnt.h`:

```C
#define ANYSIZE_ARRAY 1

...

typedef struct _SID {
  BYTE                     Revision;
  BYTE                     SubAuthorityCount;
  SID_IDENTIFIER_AUTHORITY IdentifierAuthority;
  DWORD                    SubAuthority[ANYSIZE_ARRAY];
} SID, *PISID;
```

Here, the actual length of the array is stored in the `SubAuthorityCount` member. It must be initialized by the user on input and is set by the system on output (eg., by the `AllocateAndInitializeSid()` API).

While writing my [libwin32](https://github.com/Septh/libwin32) library, I could not find an easy way to model this behavior in Koffi and ended up with a hack-ish solution, involving:
- defining the struct as always having `SID_MAX_SUB_AUTHORITIES` (15) entries in `SubAuthority`;
- defining the API as taking a `void **` parameter (instead of a `SID **`) so Koffi doesn't try and decode the structure itself (because otherwise, if the returned `SID` would only have say 5 entries, Koffi would still decode 15, possibly accessing random memory beyond the allocated struct);
- decoding the structure manually.

<details><summary>(click to see the code)</summary>

```ts
export const cSID = koffi.struct({
    Revision:            cBYTE,
    SubAuthorityCount:   cBYTE,
    IdentifierAuthority: cSID_IDENTIFIER_AUTHORITY,  // A fixed-size array of 6 bytes
    SubAuthority:        koffi.array(cDWORD, Internals.SID_MAX_SUB_AUTHORITIES, 'Array')
})
```

Then, given the C prototype for `AllocateAndInitializeSid()` is:

```C++
BOOL AllocateAndInitializeSid(
  [in]  PSID_IDENTIFIER_AUTHORITY pIdentifierAuthority,
  [in]  BYTE                      nSubAuthorityCount,
  [in]  DWORD                     nSubAuthority0,
  [in]  DWORD                     nSubAuthority1,
  [in]  DWORD                     nSubAuthority2,
  [in]  DWORD                     nSubAuthority3,
  [in]  DWORD                     nSubAuthority4,
  [in]  DWORD                     nSubAuthority5,
  [in]  DWORD                     nSubAuthority6,
  [in]  DWORD                     nSubAuthority7,
  [out] PSID                      *pSid
);
```

I wrote:

```ts
export function AllocateAndInitializeSid(identifierAuthority: SID_IDENTIFIER_AUTHORITY, subAuthorityCount: number, subAuthority0: number, subAuthority1: number, subAuthority2: number, subAuthority3: number, subAuthority4: number, subAuthority5: number, subAuthority6: number, subAuthority7: number): SID | null {
    AllocateAndInitializeSid.native ??= advapi32.func('AllocateAndInitializeSid', cBOOL, [ koffi.pointer(cSID_IDENTIFIER_AUTHORITY), cBYTE, cDWORD, cDWORD, cDWORD, cDWORD, cDWORD, cDWORD, cDWORD, cDWORD, koffi.out(koffi.pointer(cPVOID)) ])

    const pSID: OUT<unknown> = [null]
    if (AllocateAndInitializeSid.native([ identifierAuthority ], subAuthorityCount, subAuthority0, subAuthority1, subAuthority2, subAuthority3, subAuthority4, subAuthority5, subAuthority6, subAuthority7, pSID) !== 0) {
        const sid = decodeSid(pSID[0])
        freeSid()
        return sid
    }
    return null

    function freeSid(): void {
        freeSid.native ??= advapi32.func('FreeSid', cVOID, [ cPVOID ])
        freeSid.native(pSID[0])
    }
}

function decodeSid(sidPtr: unknown): SID {

    // Decode the 8-bytes header.
    const [ Revision, SubAuthorityCount, ...IdentifierAuthority ] = koffi.decode(sidPtr, 0, cBYTE, 8) as [ number, number, number, number, number, number, number, number ]

    // Decode the exact number of sub-authorities present in the SID. Yet, we still must set the array length
    // to SID_MAX_SUB_AUTHORITIES otherwise calls to other functions that take a SID parameter would fail.
    const SubAuthority: number[] = [
        ...koffi.decode(sidPtr, koffi.offsetof(cSID, 'SubAuthority'), cDWORD, SubAuthorityCount),
        ...Array(Internals.SID_MAX_SUB_AUTHORITIES - SubAuthorityCount).fill(0)
    ]

    // Return the decoded SID.
    return {
        Revision,
        SubAuthorityCount,
        IdentifierAuthority,
        SubAuthority
    }
}
```

</details>

This works, but is far from ideal. Also, it prevents me from using a disposable type, which I find unfortunate.

## The suggestion

Koffi could support variable-length arrays types by defining the array with a length of 0 (or any other special constant) and extending the `koffi.array()` prototype:

```ts
function array(ref: TypeSpec, len: number, hint?: ArrayHint | null, lengthMember?: string | null): IKoffiCType;
```

This syntax would only be valid when the array is embedded in a `struct` or `union` and the `lengthMember` parameter would be the name of the struct/union member that contains the length of the array.

Then:
- on input, Koffi would validate that the actual length of the array is the same as the value of the `lengthMember` member.
- on output, Koffi would decode the number of entries defined by the value of the `lengthMember` member.

What do you think?

